import React from 'react';
import './App.css';
import MainPage from './MainPage';
import SignInPage from './SignInPage';
import HorseDetailsPage from './HorseDetailsPage';

function App() {
  return (
    <div className="App">
      <MainPage />
      <SignInPage />
      <HorseDetailsPage />
    </div>
  );
}

export default App;
